import{
    CHANGE_STATE,
    SUBMIT_DETAILS,
} from '../constant/action-type';

function buttonClickEvent(state={},action){
    switch(action.type){
        case CHANGE_STATE:
            state = undefined
            return newState;
        case SUBMIT_DETAILS:
            newState = Object.assign({},state);
            return newState;
        default:
            return state;
    }
}

export default buttonClickEvent;
